    /**
     * 第二种解法：滑动窗口法
     */
    public static int lengthOfLongestSubstring(String s) {
        int length = s.length();
        Integer res = 0;
        HashMap<Character, Integer> map = new HashMap<>();
        //遍历一次序列，头指针/尾指针都从0开始
        for (int end = 0, start = 0; end < length; end ++){
            char character = s.charAt(end);
            if(map.get(character) != null){
                // map不含有这个key=元素的键值对时，表示不重复；如果已存在key=元素的键值对，则取出下标比较与更新头结点；
                start = Math.max(start, map.get(character));
                // 我这里纳闷，为何不直接赋值呢？因为发生重复的可能是多个元素，只有一个元素发送重复，那直接赋值没问题，但是多个元素可能重复，
                //那就要比较下了，因为新的重复元素也可以存在于另一个不重复序列里面的！
            }
            res = Math.max(res, end - start + 1);
            map.put(character, end+1);
        }
        return res;
    }

    /**
     * 第一种解法：暴力法
     */
    public static int lengthOfLongestSubstringV1(String s) {
        int length = s.length();
        int res = 0;
        for (int i=0; i<length; i++){
            for (int j=i+1; j<=length;j++){
                if(!haveDuplicateCharacter(s, i, j)){
                    res = Math.max(res, j-i);
                }
            }
        }
        return res;
    }

    private static boolean haveDuplicateCharacter(String s, int i, int j) {
        HashSet<Object> set = new HashSet<>();
        for (int start = i; start < j; start++){
            if (set.contains(s.charAt(start))){
                return true;
            }
            set.add(s.charAt(start));
        }
        return false;
    }
